import logo from './logo.svg';
import './App.scss';
import guidedog from './images/guidedog2.png'
import Bubble from './Bubble.js';
import AOS from 'aos'
import { useEffect } from 'react';
import 'aos/dist/aos.css';



function Project() {
  useEffect(() => {
    AOS.init({
      duration : 2000
    });
  }, []);

  return (
    <div className="project-container">
      <div className="project-card">
        <div style={{backgroundImage: `url(${guidedog}`, backgroundSize: "contain", backgroundPosition: "center", backgroundRepeat:"no-repeat"}} className="project-item"></div>
        <div className="bubble-container">
          <Bubble delay="5" name="Tensorflow"></Bubble>
          <Bubble name="Python"></Bubble>
          <Bubble name="JAVA"></Bubble>
        </div>
      </div>
      <div className="project-card">
        <div className="project-item"></div>
        <Bubble></Bubble>
      </div>
      <div className="project-card">
        <div className="project-item"></div>
        <Bubble></Bubble>
      </div>
      <div className="project-card">
        <div className="project-item"></div>
        <Bubble></Bubble>
      </div>



    </div>



  );
}

export default Project;
